import React, { Component } from 'react';
import LineChart from 'react-linechart';
 class LineGraph extends Component {
    render() {
        
        return (
            <div>
                <div className="App">
                    <h1>My First LineChart</h1>
                    <LineChart 
                        width={600}
                        height={400}
                        data={data}
                    />
                </div>				
            </div>
        );
    }
}export default LineGraph;
